import React from "react";
import "./Styles.css";
function Menu() {
  const fetching = () => {
    const options = {
      method: "GET",
      url: "https://tasty.p.rapidapi.com/tags/list",
      headers: {
        "x-rapidapi-host": "tasty.p.rapidapi.com",
        "x-rapidapi-key": "bd538a0cbfmshd5d6b51c7ced8d9p1b1e48jsn623334bcb300",
        useQueryString: true,
      },
    };
    fetching();

    fetch(options)
      .then((res) => res.json)
      .then((res) => res.result);
    console.log(res);
  };

  request(options, function (error, response, body) {
    if (error) throw new Error(error);

    console.log(body);
  });
  return (
    <div className="centered">
      <h2>our menu</h2>
    </div>
  );
}

export default Menu;
